commit_message:
refactor: isolate workers metrics upd1 (#131) - synchronize engine_t and metrics_retriever_t lifetime;
- split out isolate metric construction and poll init;
- isolate/metrics protocol.

Logstash plugin introduced  - logs can now be redirected to the logstash instance

Typical config:
```
...
"loggers": {
  "core": {
    "type": "logstash",
    "args" : {
      "host": "0.0.0.0",
      "port": 50030,
      "verbosity": "debug"
    }
  }
}
...
```
